import React from 'react';
import './HeaderFooter.css';

//Add Social Media
function Footer() {
  return (
    <footer className="footer">
      <p>Contact us: kejensen@yorku.ca</p>
      <p>Follow us on socials: [icons]</p>
    </footer>
  );
}

export default Footer;
